!(({ languages }) => {
  (languages.ignore = {
    comment: /^#.*/m,
    entry: {
      pattern: /\S(?:.*(?:(?:\\ )|\S))?/,
      alias: "string",
      inside: {
        operator: /^!|\*\*?|\?/,
        regex: { pattern: /(^|[^\\])\[[^\[\]]*\]/, lookbehind: !0 },
        punctuation: /\//,
      },
    },
  }),
    (languages.gitignore = languages.ignore),
    (languages.hgignore = languages.ignore),
    (languages.npmignore = languages.ignore);
})(Prism);
